css:
@-moz-document url-prefix("http://docs.oracle.com/javase/7/docs/api/"), url-prefix("https://docs.oracle.com/javase/7/docs/api/") {
html {
	background-color: black;
}
body {
	background-color: #0C090A;
	color: #ffeeee;
}
ul {
	background-color: black;
}
div.topNav, div.bottomNav {
	border-bottom: 1px solid white;
}
div.bottomNav {
	border-top: 1px solid white;
}
div.subNav {
	background-color: black;
}
li.blockList, li.blockList h3, li.blockList h4 {
	background-color: black !important;
}
.altColor {
	background-color: #0C090A;
}
.rowColor {
	background-color: #1d1518;
}
th.colFirst, th.colLast, h1.bar {
	background: #2C3539;
}
.navBarCell1Rev, caption span {
	background-color: #745761;
	border-color: #745761;
}
.navBarCell1Rev, caption span, h1.bar, div.topNav, div.bottomNav {
	background-image: none !important;
}
}
